import React from 'react'
import { NavLink } from "react-router-dom";

const Suggestions = (props) => {
  const options = props.results.map(res => (
    <li key={res.id}>
      {res.overskrift}
    </li>
  ))
  return <ul>{options}</ul>
}

export default Suggestions
